INSERT INTO `pages` (`id`, `handle`, `name`, `content`, `title`, `description`, `created_at`, `updated_at`) VALUES
(1, 'home', 'Hjem', '{"section_one": {"html": true, "text": "<h1>Velkommen til Barefilter.no</h1>\\n                                    <p>Sammen med Interfil, en av Norges ledende produsenter av filter til ventilasjonsanlegg,\\n                                        leverer Barefilter.no ventilasjonsfilter til eneboliger, industri, små og store prosjekter\\n                                        og både til private og offentlige virksomehter.</p>", "title": "Velkommen til Barefilter.no", "$$hashKey": "object:34"}}', '', '', '2018-02-07 02:03:34', '2018-02-07 02:03:34'),
(2, 'subscription', 'Filterabonnemnet', '{"section_one": {"html": true, "text": "<h1>Filteravtale</h1>\\n                            <p>For å opprettholde frisk og god luftkvalitet i bygget er det viktig å bytte filter med jevne\\n                                mellomrom. Vi tilbyr derfor filteravtale slik at det blir det enkelt å bytte filter på\\n                                ventilasjonsanlegget. Ved å tegne filteravtale vil vi sende dere filter til avtalt tid.\\n                                Er dere flere feks. boretslag/sammeie kan dere også ta kontakt for å få egen rabattkode\\n                                på deres bestillinger.</p>", "title": "Filteravtale", "$$hashKey": "object:113"}, "section_two": {"html": true, "text": "<h2>Fordeler ved filteravtale</h2>\\n                    <p>Dere får tilsendt filter en eller to ganger pr. år eller etter eget ønske.</p>\\n                    <ul>\\n                        <li>Ren og god filtert luft i deres bolig</li>\\n                        <li>Lavere stømutgifter ved riktig&nbsp;filter</li>\\n                        <li>Rabatt på filter&nbsp;</li>\\n                        <li>Rabatt på frakt</li>\\n                        <li>Gratis support</li>\\n                        <li>Dokumentasjon på kjøp av filter ved en evt. reklamasjonssak</li>\\n                        <li>Sertifiserte filter av høy kvalitet.</li>\\n                        <li>Faktura på e-post</li>\\n                        <li>Ingen forhåndsbetaling</li>\\n                        <li>Lett å si opp avtalen ingen oppsigelsetid</li>\\n                    </ul>", "title": "Fordeler ved filteravtale", "$$hashKey": "object:114"}, "section_three": {"html": true, "text": "<h2>Når skal du bytte filter?</h2>\\n                    <p>Det beste er å bytte etter bestemte intervaller. som evt før og etter en pollensesong. Et ventilasjonsfilter\\n                        bør stå i\\n                        <strong>maksimum 12 måneder</strong>.Under drift vil filtrene ofte samle opp biologisk materiale som\\n                        forråtner, pollensporer som kan avgi allergener, og farlige tungmetaller.</p>", "title": "Når skal du bytte filter?", "$$hashKey": "object:115"}}', '', '', '2018-02-07 02:08:33', '2018-02-07 02:08:33'),
(3, 'partner', 'Partner', '{"section_one": {"html": true, "text": "<h1>Bli Partner</h1>\\n                            <p>Vi tilbyr partneravtale til firmaer som driver med salg, montering og service av ventilasjonsanlegg.</p>\\n                            <p>Ta kontakt med Bare filter AS for en prat om dette.</p>", "title": "Bli Partner", "$$hashKey": "object:176"}, "section_two": {"html": true, "text": "<h2>Fordeler med å være Partner</h2>\\n                    <p>Dersom ditt firma gjennomfører serviceoppdrag kan vi sende oppdrag videre fra våre filterkunder dersom de trenger hjelp til å bytte filter eller har behov for service på sitt ventilasjonsanlegg. Når vi mottar forespørsel om slike oppdrag vil vi ta kontakt med den partneren som tilhører distriktet kunden kommer fra slik at avstanden blir kortest mulig. </p>\\n                    <p>Til våre partnere tilbyr vi egen pålogging til en egen side hvor dere kan administrere deres kunder.</p>\\n                    <p>Det er gratis å være partner, men har mange fordeler:</p>\\n                    <ul>\\n                        <li>Gode priser på filter</li>\\n                        <li>Tillgang til kundeside&nbsp;for å administrere deres kunder</li>\\n                        <li>Markedsføring</li>\\n                        <li>Serviceoppdrag</li>\\n                        <li>Faglig nettverk</li>\\n                    </ul>", "title": "Fordeler med å være Partner", "$$hashKey": "object:177"}}', '', '', '2018-02-07 02:10:03', '2018-02-07 02:10:03'),
(4, 'about', 'Om Oss', '{"section_one": {"html": true, "text": "<h1>Om oss</h1>\\n                                <p>Bare filter AS&nbsp;er et &nbsp;firma som selger sertifiserte kvalitetsfilter fra Interfil AS. Interfil AS er en av Norges ledende produsenter av filter til ventilasjonsanlegg.</p>\\n                                <p>Bare filter AS er et&nbsp;firma så&nbsp;har&nbsp;ca. 27&nbsp;år &nbsp;erfaring fra ventilasjonsbransjen/klimateknikk. Vi leverer ventilasjonsfilter til private eneboliger og industri, til små og store prosjekter og både private og&nbsp; offentlige virksomheter.&nbsp;</p>\\n                                <p>Skulle det være et filter du savner i nettbutikken vår så ta kontakt, vår leverandør har ca.30 000 artikler på lager og evt kan filter lages etter mål og ønske.</p>", "title": "Om Oss", "$$hashKey": "object:206"}, "section_two": {"html": true, "text": "<h2>Service og god kundestøtte</h2>\\n                            <p>Med lang erfaring fra bransjen vet vi hvor viktig&nbsp;det er å få god hjelp når en trenger det. Vi vil bestrebe oss på å være tilgjengelig for våre kunder dersom det skulle oppstå problemer. Skulle det være behov for tekniker så har vi bred kontaktflate i Norge og kan bistå med å få bestilt en tekniker dersom det er problemer som krever mer enn hjelp over telefonen.</p>\\n                            <p>Våre mål er:</p>\\n                            <ul>\\n                            \\t<li>Konkuransedyktige priser på ventilasjonsfilter</li>\\n                            \\t<li>Sertifiserte kvalitetsfilter fra velkjent norsk&nbsp;leverandør</li>\\n                            \\t<li>Yte rask og god&nbsp;support til alle våre&nbsp;kunder</li>\\n                            \\t<li>Kjapp levering direkte fra lager</li>\\n                            </ul>", "title": "Service og god kundestøtte", "$$hashKey": "object:207"}}', '', '', '2018-02-07 02:11:15', '2018-02-07 02:11:15'),
(5, 'support', 'Support', '{"section_one": {"html": true, "text": "<h1>Support og fordeler</h1>\\n                            <p>Bare filter AS er ikke en ren nettbutikk, dere skal også få god service når dere trenger hjelp til bestilling av filter eller har problemer med anlegget. Vi gir gratis support til alle våre kunder.</p>", "title": "Support og fordeler", "$$hashKey": "object:236"}, "section_six": {"html": true, "text": "<h3>Kundeservice</h3>\\n                <p>Finn svar på ofte stilte spørsmål for filter, betaling, levering, tips og triks&nbsp;og mye mer ved å trykke <a href=\\"/support/\\">her</a>.&nbsp;</p>", "title": "Kundeservice", "$$hashKey": "object:237"}, "section_two": {"html": true, "text": "<h3>Besøksadresse</h3>\\n                <p>Ring oss gjerne for å avtale besøkstid. Vi har besøksadresse Valevegen 22<strong>, 5451 Valen.</strong></p>", "title": "Besøksadresse", "$$hashKey": "object:238"}, "section_five": {"html": true, "text": "<h3>Live Chat</h3>\\n                <p>Chattefunksjonen er tilgjengelig på hverdager fra kl.08:00-20:00.</p>", "title": "Live Chat", "$$hashKey": "object:239"}, "section_four": {"html": true, "text": "<h3>E-post Support</h3>\\n                <p>Vi er tilgjengelig på e-post <strong>kontakt@barefilter.no </strong>på hverdager fra kl 08:00-15:00.</p>\\n                <p>For abonnementskunder er vi også tilgjengelig på hverdager på kveldstid fra 17:00-20:00.</p>\\n                <p>Utenom disse tidene svarer vi så snart vi kan, men senest neste arbeidsdag.</p>", "title": "E-post Support", "$$hashKey": "object:240"}, "section_three": {"html": true, "text": "<h3>Telefon Support</h3>\\n                <p>Vi er tilgjengelig på telefon <strong>+47 47 14&nbsp;5000&nbsp;</strong>hverdager fra kl.07:00-15:00.</p>\\n                <p>For våre abonnementskunder er vi også tilgjengelig på hverdager på kveldstid fra kl.17:00-20:00.</p>", "title": "Telefon Support", "$$hashKey": "object:241"}}', '', '', '2018-02-07 02:14:19', '2018-02-07 02:14:19'),
(6, 'contact', 'Kontakt Oss', '{"section_one": {"html": true, "text": "<h1>Kontakt oss</h1>\\n                            <p>Har du spørsmål rundt våre produkter eller tjenester? Kanskje du ønsker å bli Partner eller Proffkunde?</p>\\n                            <p>Uansett hva det måtte gjelde, ta kontakt og vi hjelper deg!!!</p>", "title": "Kontakt oss", "$$hashKey": "object:14"}, "section_six": {"html": true, "text": "<h3>Åpningstider</h3>\\n                      <p><b>Man-Fre:</b> 08:00 - 20:00<br>\\n                        <b>Lør-Søn:</b> 12:00 - 16:00\\n                      </p>", "title": "Åpningstider", "$$hashKey": "object:15"}, "section_two": {"html": true, "text": "<h3>Besøksadresse</h3>\\n<p><b>Bare Filter AS</b><br>Valevegen 22 <br>5451 VALEN</p>\\n", "title": "Besøksadresse", "$$hashKey": "object:16"}, "section_five": {"html": true, "text": "<h3>Telefonsupport</h3>\\n                      <a href=\\"tel:+4747145000\\">+47 47 14 5000</a>", "title": "Telefonsupport", "$$hashKey": "object:17"}, "section_four": {"html": true, "text": "<h3>E-postadresse</h3>\\n                      <p><b>Generelle henvendelser:</b> <a href=\\"kontakt@barefilter.no\\">kontakt@barefilter.no</a></p>\\n                      <p><b>Fakturahenvendelser:</b> <a href=\\"faktura@barefilter.no\\">faktura@barefilter.no</a></p>", "title": "E-postadresse", "$$hashKey": "object:18"}, "section_three": {"html": true, "text": "<h3>Henteadresse</h3>\\n                      <p><b>Bare Filter AS</b><br>Valevegen 22 <br>5451 VALEN</p>", "title": "Henteadresse", "$$hashKey": "object:19"}}', '', '', '2018-02-07 02:30:44', '2018-02-07 02:30:44'),
(7, 'tos', 'Salgs- og leveringsbetingelser', '{"section_one": {"html": true, "text": "<h1>Salgs- og leveringsbetingelser 2017</h1>\\n                <p><strong>Telefon:</strong> 47 14 5000 &nbsp;| &nbsp;<strong>E-post:</strong> kontakt@barefilter.no &nbsp;| &nbsp;<strong>Adresse:</strong>&nbsp;Valevegen 22 5451 Valen</p>\\n                <p>&nbsp;</p>\\n                <h3>1. Anvendelse</h3>\\n                <p>Disse standard salgs- og leveringsbetingelser får anvendelse ved&nbsp;alt salg fra BARE FILTER AS, såfremt ikke annet er avtalt særskilt mellom partene.</p>\\n                <h3>2. Ordre/Bestilling</h3>\\n                <p>Ved bestilling før kl. 12.00, vil lagerførte varer normalt ekspederes samme dag. Kjøper er ansvarlig for at det&nbsp;oppgis eventuelle referanser, rekvisisjonsnummer, bestillingsnummer og andre relevante opplysninger som kreves for at&nbsp;levering og fakturering skal skje uten unødig opphold og arbeid.</p>\\n                <h3>3. Pris og frakt</h3>\\n                <p>Alle priser på filter til enebolig er oppgitt inkl. mva.</p>\\n                <p>Alle priser på industrifilter er oppgitt inkl.mva.</p>\\n                <p>Filterpakker til enebolig sendes for 98,- med hent i butikk</p>\\n                <h3>4. Betaling</h3>\\n                <p>Betaling kan gjøres som kontantbetaling direkte i nettbutikken via Nets eller Faktura på mail.</p>\\n                <p>Dersom du ønsker faktura på e-post påløper et fakturagebyr på kr.35 per faktura, og standard betalingsbetingelser er 10 dager fra fakturadato. Etter forfall belastes 8,5 % rente pr. år. Ved purring/inkassovarsel påløper gebyr iht. “Forskrift til inkassoloven”. Forbehold om kontantsalg ved mislighold eller dårlig kredittverdighet.</p>\\n                <h3>5. Leveringstid</h3>\\n                <p>Leveringstiden fra fabrikk er normalt 2-5&nbsp;dager fra mottatt bestilling. Vi tar imidlertid forbehold om at enkelte varer kan bli&nbsp;utsolgt fra lager.</p>\\n                <p>Vi fraskriver oss et hvert ansvar for eventuelle følger av forsinkelser.</p>\\n                <p>Kjøper er ansvarlig for at korrekt og fullstendig leveringsadresse er oppgitt, for å unngå forsinkelser i leveringen.</p>\\n                <h3>6. Garanti</h3>\\n                <p>BARE FILTER AS garanterer at de leverte varene ved leveringen oppfyller de spesifikasjoner som gjelder for varene i henhold tilordrebekreftelse. Garantien omfatter kun fabrikasjonsfeil og ikke følgeskader. Forøvrig gjelder kjøpslovens bestemmelser.</p>\\n                <h3>7. Reklamasjon</h3>\\n                <p>Ved mottakelse av varen må kjøper av varen inspisere denne og reklamere eventuelle feil og mangler uten ugrunnet opphold, dog senest 14 dager fra varen er mottatt. Reklamasjon på feil og mangler som først&nbsp;oppdages etter montering og prøvekjøring av varen, skal skje straks feilen/mangelen oppdages.</p>\\n                <h3>8. Retur og angrerett</h3>\\n                <p>Retur som skyldes feil/mangler hos leverandør skjer på leverandørens bekostning.</p>\\n                <p><strong>Øvrig retur:</strong>&nbsp;Spesialbestilte varer tas ikke i retur dersom varene er etter kjøpers beskrivelse (filterklasse og dimensjon).</p>\\n                <p><strong>Retur av standardprodukter:</strong>&nbsp;Skjer kun&nbsp;etter avtale med BARE FILTER AS, kundeservice. <a href=\\"mailto:filter@barefilter.no\\">kontakt@barefilter.no</a>&nbsp; eller tlf 47 14 5000</p>\\n                <p>Skulle du ha fått feil filter fra oss så tar dere kontakt og vi sender dere nytt filter og vi sender deg en retur lapp for det filteret som var feil vederlagsfritt.</p>\\n                <p><strong>Angrerett:</strong>&nbsp;Forbruker kan gå fra avtalen uten å oppgi noen grunn innen 14 dager etter at selger har oppfylt sin opplysningsplikt i henhold til angrerettloven, og varen og angrerettskjema er mottatt.</p>\\n                <h3>9. Salgspant</h3>\\n                <p>BARE FILTER AS har salgspant i de solgte varene som sikkerhet for sitt krav på kjøpesummen med tillegg av renter og omkostninger,&nbsp;jfr. pantelovens §§ 3-14 inntil varene er betalt i sin helhet.</p>\\n                <h3>10. Tvister</h3>\\n                <p>Alle rettsspørsmål som måtte oppstå skal bedømmes i henhold til norsk lov.</p>\\n                <p>&nbsp;</p>\\n                <p><em>Sist endret: 31.januar 2017</em></p>", "title": "Salgs- og leveringsbetingelser", "$$hashKey": "object:53"}}', '', '', '2018-02-07 04:19:40', '2018-02-07 04:19:40'),
(8, 'customer', 'Kunde','[{"category":"Generelt","answer":[{"question":"Barefilter.no og nettbutikk","answer":"<p><span style=\"color: rgb(51, 51, 51);\">Vi skal være deres partner som kan hjelpe dere med deres anlegg og ikke bare en nettbutikk i “skyene”&nbsp;</span><br style=\"color: rgb(51, 51, 51);\"><span style=\"color: rgb(51, 51, 51);\">Av erfaring så vet vi at det altid dukker opp feil på maskinene før eller siden.&nbsp;</span><br style=\"color: rgb(51, 51, 51);\"><span style=\"color: rgb(51, 51, 51);\">Som kunde hos oss skal dere få den hjelpen som trengs og en telefon å ringe til når dere trenger hjelp.</span><br></p>","$$hashKey":"object:28"},{"question":"Jeg ønsker å bli Proffkunde, hva gjør jeg","answer":"<p><span style=\"color: rgb(51, 51, 51);\">Som proffkunde får dere egen loggin i våres programm for adminidtrere deres kunder som bla abbonomang, og selvsakt dei beste prisene på filter og andre fordeler dette innebærer.&nbsp;</span><br style=\"color: rgb(51, 51, 51);\"><span style=\"color: rgb(51, 51, 51);\">Ta kontakt Med Bare filter AS for å få loggin til dette programmet og rabattordninger</span><br></p>","$$hashKey":"object:117"},{"question":"Jeg ønsker å bli Partner, hva gjør jeg","answer":"<span style=\"color: rgb(51, 51, 51);\">Dersom du er en god teknikker og bred erfaring på service,ta kontakt med oss og vi koder deg inn i programmet slik at serviceoppdrag kommer til dere i deres distrikt.&nbsp;</span><br style=\"color: rgb(51, 51, 51);\"><span style=\"color: rgb(51, 51, 51);\">Som partner får dere ogs andre fordeler, ta kontakt så får dere vite mer.&nbsp;</span><br style=\"color: rgb(51, 51, 51);\"><span style=\"color: rgb(51, 51, 51);\">Barefilter.no har som mål å dekke hele Norge ang service.</span>","$$hashKey":"object:119"},{"question":"Vi har flere bygg/eigendommer, har dere en løsning for dette","answer":"<span style=\"color: rgb(51, 51, 51);\">Som kunde hos oss kan du enkelt logge inn i programmet her og adminstrere bygga dine. med noen enkle valg så ligger anlegga lagret slik at du evt kan få en påminnelseta at det er på tide med evt service eller bare filterbytte. Dere får da også tillgang til historikk fakturaarkiv. og avt abbonomanget deres&nbsp;</span><br style=\"color: rgb(51, 51, 51);\"><span style=\"color: rgb(51, 51, 51);\">Har dere flere bygg så ta kontakt med Bare filter AS sik at vi får lagt inn fast rabatt på dere.</span>","$$hashKey":"object:121"},{"question":"Skal du selge eller kjøpe hus med ventilasjon","answer":"<span style=\"color: rgb(51, 51, 51);\">Dersom dere skal selge huset eller vurderer å kjøpe kan våres teknikkerer komme med en uavhengi rapport på deres ventilasjonsanlegg, slik at ikke problemer oppstår etter kjøp/salg. Dette sikrer dere at maskinen fungerer som den skal. Fyll ut skjemat på forsiden å skriv at dere ønsker en sjekk i forbindelse med med evt kjøp eller salg.</span>","$$hashKey":"object:123"},{"question":"Jeg finner ikke filteret i deres nettbutikk, hva gjør jeg","answer":"<span style=\"color: rgb(51, 51, 51);\">Skulle dere ikke finne filteret som passer deres maskin så ta kontakt med oss.&nbsp;</span><br style=\"color: rgb(51, 51, 51);\"><span style=\"color: rgb(51, 51, 51);\">Våres leverandør ha ca 30 000 artikler så vi kan ikke legge inn alle desse.&nbsp;</span><br style=\"color: rgb(51, 51, 51);\"><span style=\"color: rgb(51, 51, 51);\">Fabrikken lager også filter etter ønsket mål fra dere, så vi kan garantert hjelpe dere slik dere får filteret dere ønsker.</span>","$$hashKey":"object:125"},{"question":"Vi trenger service, hva gjør jeg","answer":"<span style=\"color: rgb(51, 51, 51);\">Det fikser vi lett,da vi mest sansyleg har en partnerer i ditt distrikt som kan hjelpe dere.&nbsp;</span><br style=\"color: rgb(51, 51, 51);\"><span style=\"color: rgb(51, 51, 51);\">Skriv navnet deres i adressefeltet og trykk “send” da går det en ordre til nærmeste partner i ditt distrikt. Dere får da en bekreftelse på dette. Teknikker vil da ta kontakt med dere for å avtale et service besøk til fastpris. Alle teknikker har lang erfaring og kan utføre service alle merker.&nbsp;</span><br style=\"color: rgb(51, 51, 51);\"><span style=\"color: rgb(51, 51, 51);\">Bare filter AS står for faktureringen til kunde.&nbsp;</span><br style=\"color: rgb(51, 51, 51);\"><span style=\"color: rgb(51, 51, 51);\">Som filterkunde får dere rabatt på service og deler.</span>","$$hashKey":"object:127"},{"question":"Har dere bruksanvisning til maskinene","answer":"<span style=\"color: rgb(51, 51, 51);\">Vi jobber med å legge inn alle dokumenter til hver maskin hos oss.&nbsp;</span><br style=\"color: rgb(51, 51, 51);\"><span style=\"color: rgb(51, 51, 51);\">Dette blir kun tilgjengelig for våres kunder som en fordel å være kunde hos oss.&nbsp;</span><br style=\"color: rgb(51, 51, 51);\"><span style=\"color: rgb(51, 51, 51);\">Dersom du har gjort et kjøp i nettbutikken vil dere få tillgang til dette.</span>","$$hashKey":"object:129"},{"question":"Skal dere kjøpe eller selge hus med ventilasjonsanlegg","answer":"<span style=\"color: rgb(51, 51, 51);\">Dersom dere skal selge huset eller vurderer å kjøpe kan våres teknikkerer komme med en uavhengi rapport på deres ventilasjonsanlegg, slik at ikke problemer oppstår etter kjøp/salg. Dette sikrer dere at maskinen fungerer som den skal.&nbsp;</span><br style=\"color: rgb(51, 51, 51);\"><span style=\"color: rgb(51, 51, 51);\">Fyll ut skjemat på forsiden å skriv at dere ønsker en sjekk i forbindelse med med evt kjøp eller salg.</span>","$$hashKey":"object:131"},{"question":"Jeg har sendt en SMS til Barefilter.no, men får ingen svar","answer":"<span style=\"color: rgb(51, 51, 51);\">Dette skyldes at våres telefonr, 47 14 5000 er et sentralbordnr som er viderkoblet og kan derfor ikke motta SMS.</span>","$$hashKey":"object:133"},{"question":"Driver Barefilter.no med servce av ventilasjonsanlegg","answer":"<span style=\"color: rgb(51, 51, 51);\">Ja i tillegg til nettbutikken så har vi avtaler med teknikkere med lang erfaring innen serviceoppdrag.&nbsp;</span><br style=\"color: rgb(51, 51, 51);\"><span style=\"color: rgb(51, 51, 51);\">Dersom dere har et anlegg med Varmepumpe så har teknikker F-gass godkjenning for dette.&nbsp;</span><br style=\"color: rgb(51, 51, 51);\"><span style=\"color: rgb(51, 51, 51);\">Vi er en sammenslutting ang innkjøp av filter for å ha noe av dei beste filtera og pris på markedet.</span>","$$hashKey":"object:135"},{"question":"Hvorfor selger dere gode filter billig.","answer":"<span style=\"color: rgb(51, 51, 51);\">For å klare å holde konkeransdyktige priser på filter så har vi utviklet et nytt programm gjennom “Fantasy Lab“ Slik at vi ikke trenger og handterer ordrene mer en nødvendigt, da dette blir kodet rett i våres programm. Både med abbonomang ,service-partnerskap-faktura osv. Hele butikken er skreddersydd for denne bransjen og bygget opp fra bunnen av med avansert koding.</span>","$$hashKey":"object:137"}],"$$hashKey":"object:25"},{"category":"Tips & Triks","answer":[{"question":"Filterlyset lyser selv om jeg har byttet filter, hva gjør jeg","answer":"<span style=\"color: rgb(51, 51, 51);\">De aller flest maskiner har en reset knapp for filtertimer denne går på innstilte måneder og må manuelt resettes på feks 6-12 mnd. Se bruksanvisning for ditt anlegg.&nbsp;</span><br style=\"color: rgb(51, 51, 51);\"><span style=\"color: rgb(51, 51, 51);\">Skulle dere få problemer med dette så ikke nøl med å kontakte Bare filter AS.&nbsp;</span><br style=\"color: rgb(51, 51, 51);\"><span style=\"color: rgb(51, 51, 51);\">Dersom dere er kunde får du gratis support.&nbsp;</span><br style=\"color: rgb(51, 51, 51);\"><span style=\"color: rgb(51, 51, 51);\">Skulle dere trenge hjelp eller opplæring på dette så har vi teknikkere som kommer å hjelper deg med dette til en fastpris.</span>","$$hashKey":"object:42"},{"question":"Anlegget gearer opp og ned på luftmengdene","answer":"<p><span style=\"color: rgb(51, 51, 51);\">Dette kan skyldes flere årsaker.Har dere et ventilasjonsanlegg med fukt sensor så kan denne registrere dette for å så geare opp anllegt og bli kvitt fukt. Har dere et anlegg med innebygget varmepumpe så kan dette også skyldes høg innblåsingstemperatur, Tilluftsviften vil da geare opp slik at maskinen ikke får pressostatfeil for trykk og temperaturer henger sammen.</span><br></p>","$$hashKey":"object:43"},{"question":"Pressostatfeil","answer":"<span style=\"color: rgb(51, 51, 51);\">Dette er en feil som har koblet ut kompressor pga høgtrykk i anlegget deres,slik at den verken varmer eller kjøler. prøv med manuell resett,dere finner en knapp på maskinen for dette,skulle feilen komme tilbake så ta kntakt med oss. Dette er også en feil som “kan” fikses på en enkel måte når en vet hva en skal se etter. Her kan vi hjelpe med tips over telefon da vi har lang erfaring med slike alarmer.</span>","$$hashKey":"object:45"},{"question":"Ventilasjonsanlegget våres blåser iskald luft, hva gjør jeg","answer":"<span style=\"color: rgb(51, 51, 51);\">På ventilasjonsanlegget deres så er det et elektrisk varmebatteri, det kan hende at branntermoststen/overoppheting er koblet ut.&nbsp;</span><br style=\"color: rgb(51, 51, 51);\"><span style=\"color: rgb(51, 51, 51);\">Til varmebatteriet er det en reset knapp, trykk inn den for å se om maskinen da varmer.&nbsp;</span><br style=\"color: rgb(51, 51, 51);\"><span style=\"color: rgb(51, 51, 51);\">Skulle den ikke varme kan det også være noe galt med styringen til varmebatteriet.&nbsp;</span><br style=\"color: rgb(51, 51, 51);\"><span style=\"color: rgb(51, 51, 51);\">Er du filterkunde så får dere gratis support,eller et teknikker hjem til dere for å sjekke dette til en fast pris.</span>","$$hashKey":"object:47"},{"question":"Vi har ventilasjonsanlegg med innebygget varmepumpe og føler dårlig effekt, hva gjør jeg","answer":"<span style=\"color: rgb(51, 51, 51);\">Ventilasjonsanlegg med innebygget varmepumpe,skulle dere slite med liten effekt på varme og evt. kjøling, så bør dere ha en teknikker til å se på maskinen, dette er pga mest sansyneleg kan denne feilen skyldes noe på kjølekretsen evt. deffekte følerer som gjør at ikke kompressor får startsignal.&nbsp;</span><br style=\"color: rgb(51, 51, 51);\"><span style=\"color: rgb(51, 51, 51);\">Som filterkunde får dere da rabatt på reservedeler.</span>","$$hashKey":"object:49"},{"question":"Vi ønsker ikke å bytte filter selv, hva gjør jeg","answer":"<span style=\"color: rgb(51, 51, 51);\">Ring eller send en mail til Bare filter så setter vi deg i kontakt med en teknikker som har lang erfaring på dette.&nbsp;</span><br style=\"color: rgb(51, 51, 51);\"><span style=\"color: rgb(51, 51, 51);\">Vi tilbyr også vedlikeholdsavtaler på anlegg til Boligventilasjon til fastpris.</span>","$$hashKey":"object:51"},{"question":"Garanti utløpstest","answer":"<span style=\"color: rgb(51, 51, 51);\">Husk at dere som har en maskin som er av nyere dato, dere kan og bør få en uavhengi test av deres anlegg slik at feil oppdages før garantien utløper på deres anlegg, ta kontakt og vi sender en teknikker til dere som kommer med en utvidet testrapport,med dette kan dyre repparasjoner oppdages før garantien utløper.</span>","$$hashKey":"object:53"},{"question":"Ventilasjonsanlegg med varmtvannoppvarming og varmepumpe","answer":"<span style=\"font-weight: 700; color: rgb(51, 51, 51);\">Vi har ikke varmtvann til å dusje og luften som blåser inn i huset er iskald.</span><span style=\"color: rgb(51, 51, 51);\">&nbsp;</span><br style=\"color: rgb(51, 51, 51);\"><span style=\"color: rgb(51, 51, 51);\">Da er vi sikker på at her går ikke kompressor som den burde,se på menyen om det er noen alarmer som Pressostatfeil (manuell reset).&nbsp;</span><br style=\"color: rgb(51, 51, 51);\"><span style=\"color: rgb(51, 51, 51);\">Sjekk også om det kan være en deffekt føler (må byttes).&nbsp;</span><br style=\"color: rgb(51, 51, 51);\"><span style=\"color: rgb(51, 51, 51);\">Sjekk også om det er feil på en vifte, som gjør at dere får pressostatfeil.&nbsp;</span><br style=\"color: rgb(51, 51, 51);\"><span style=\"color: rgb(51, 51, 51);\">Sjekk også om det er fFeil på avrimingfunksjonen, se om det er is inne i maskinen.&nbsp;</span><br style=\"color: rgb(51, 51, 51);\"><span style=\"color: rgb(51, 51, 51);\">Skulle noen av desse feilene være hos dere så kan du kontakte Bare Filter AS.&nbsp;</span><br style=\"color: rgb(51, 51, 51);\"><span style=\"color: rgb(51, 51, 51);\">Som kunde kan du også ringe kveld/helg dersom dere har kald vann.(med lang erfaring på slike anlegg kan mye løses pr tlf) Da ikke alle feilsøkingtips blir lagt offentlig.</span>","$$hashKey":"object:55"}],"$$hashKey":"object:39"},{"category":"Borettslag og sameie","answer":[{"question":"Jeg ønsker filter til Borettslag og Sameie, hvordan fungerer dette-1","answer":"<p><span style=\"color: rgb(51, 51, 51);\">Dersom dere har flere anlegg så får dere en pakkepris på filter.&nbsp;</span><br style=\"color: rgb(51, 51, 51);\"><span style=\"color: rgb(51, 51, 51);\">Dere kan også få samlefaktura eller til hver enkel beboer.</span><br></p>","$$hashKey":"object:36"},{"question":"Nohman test","answer":"<span style=\"color: rgb(51, 51, 51);\">Vi tilbyr også rabattkoder for deres boretslag dersom dere ikke ønsker et felles bestilling, ta kontakt oss så får dere en kode til deres boretslag. ttetet</span>","$$hashKey":"object:38"},{"question":"Nohman er best","answer":"<p>test answer</p>","$$hashKey":"object:271"}],"$$hashKey":"object:33"},{"category":"Ordre","answer":[{"question":"Når vil min ordre ekspederes","answer":"<p><span style=\"color: rgb(51, 51, 51);\">Ved bestilling før kl. 12.00, vil lagerførte varer normalt ekspederes samme dag. Kjøper er ansvarlig for at det oppgis eventuelle referanser, rekvisisjonsnummer, bestillingsnummer og andre relevante opplysninger som kreves for at levering og fakturering skal skje uten unødig opphold og arbeid.</span><br></p>","$$hashKey":"object:59"},{"question":"Kan jeg ringe inn en bestilling av filter","answer":"<span style=\"color: rgb(51, 51, 51);\">Ja, det er bare å ringe så kan vi legge inn bestillingen for dere.</span>","$$hashKey":"object:61"}],"$$hashKey":"object:56"},{"category":"Levering","answer":[{"question":"Hva skjer med filter som ikke blir hentet på postkontoret","answer":"<p><span style=\"color: rgb(51, 51, 51);\">Dersomt filteret blir bestilt, men ikke hentet på postkontoret vil filteret bli sendt tilbake til fabrikken hvor dere må betale fraktkostnadene.</span><br></p>","$$hashKey":"object:57"},{"question":"Vi rakk ikke å hente filteret før det ble returnert, hva gjør jeg","answer":"<span style=\"color: rgb(51, 51, 51);\">Fortvil ikke, ta kontakt med Barefilter.no og vi sender det på nytt,husk da at frakten tillkommer på nytt</span>","$$hashKey":"object:59"},{"question":"Hva er leveringstiden på filter","answer":"<span style=\"color: rgb(51, 51, 51);\">Leveringstiden fra fabrikk er normalt 1-3 dager fra mottatt bestilling. Vi tar imidlertid forbehold om at enkelte varer kan bli utsolgt fra lager.&nbsp;</span><br style=\"color: rgb(51, 51, 51);\"><span style=\"color: rgb(51, 51, 51);\">Vi fraskriver oss et hvert ansvar for eventuelle følger av forsinkelser.&nbsp;</span><br style=\"color: rgb(51, 51, 51);\"><span style=\"color: rgb(51, 51, 51);\">Kjøper er ansvarlig for at korrekt og fullstendig leveringsadresse er oppgitt, for å unngå forsinkelser i leveringen.</span>","$$hashKey":"object:61"}],"$$hashKey":"object:54"},{"category":"Betaling","answer":[{"question":"Vi har et abonnement, hvordan betaler jeg","answer":"<span style=\"color: rgb(51, 51, 51);\">Hvis dere har et abonnement kommer det faktura på dette i etterkant når dere har fått filteret.</span>","$$hashKey":"object:72"},{"question":"Hvilken betalingsalternativer har dere","answer":"<span style=\"color: rgb(51, 51, 51);\">Ved kjøp av filter kan dere benytte dere av disse betalingsalternativene:</span><ul style=\"color: rgb(51, 51, 51);\"><li>Visa, MasterCard</li><li>NetAxept</li><li>Faktura</li></ul><span style=\"color: rgb(51, 51, 51);\">Standard betalingsbetingelser er 10 dager etter fakturadato. Etter forfall belastes 12% rente pr. år.&nbsp;</span><br style=\"color: rgb(51, 51, 51);\"><span style=\"color: rgb(51, 51, 51);\">Ved kontantbetaling som med bla.VISA Ved purring/inkassovarsel påløper gebyr iht. “Forskrift til inkassoloven”.&nbsp;</span><br style=\"color: rgb(51, 51, 51);\"><span style=\"color: rgb(51, 51, 51);\">Forbehold om kontantsalg ved mislighold eller dårlig kredittverdighet.</span>","$$hashKey":"object:74"},{"question":"Vi ønsker ikke å bytte filter selv, hva gjør jeg","answer":"<span style=\"color: rgb(51, 51, 51);\">Ring eller send en mail til Bare filter så setter vi deg i kontakt med en teknikker som har lang erfaring på dette.&nbsp;</span><br style=\"color: rgb(51, 51, 51);\"><span style=\"color: rgb(51, 51, 51);\">Vi tilbyr også vedlikeholdsavtaler på anlegg til Boligventilasjon til fastpris.</span>","$$hashKey":"object:76"}],"$$hashKey":"object:69"},{"category":"Refundering, angrerett & reklamasjon","answer":[{"question":"Filterlyset lyser selv om jeg har byttet filter, hva gjør jeg","answer":"<p><span style=\"color: rgb(51, 51, 51);\">De aller flest maskiner har en reset knapp for filtertimer denne går på innstilte måneder og må manuelt resettes på feks 6-12 mnd. Se bruksanvisning for ditt anlegg.&nbsp;</span><br style=\"color: rgb(51, 51, 51);\"><span style=\"color: rgb(51, 51, 51);\">Skulle dere få problemer med dette så ikke nøl med å kontakte Bare filter AS.&nbsp;</span><br style=\"color: rgb(51, 51, 51);\"><span style=\"color: rgb(51, 51, 51);\">Dersom dere er kunde får du gratis support.&nbsp;</span><br style=\"color: rgb(51, 51, 51);\"><span style=\"color: rgb(51, 51, 51);\">Skulle dere trenge hjelp eller opplæring på dette så har vi teknikkere som kommer å hjelper deg med dette til en fastpris.</span><br></p>","$$hashKey":"object:66"},{"question":"Ventilasjonsanlegget våres blåser iskald luft, hva gjør jeg","answer":"<span style=\"color: rgb(51, 51, 51);\">På ventilasjonsanlegget deres så er det et elektrisk varmebatteri, det kan hende at branntermoststen/overoppheting er koblet ut.&nbsp;</span><br style=\"color: rgb(51, 51, 51);\"><span style=\"color: rgb(51, 51, 51);\">Til varmebatteriet er det en reset knapp, trykk inn den for å se om maskinen da varmer.&nbsp;</span><br style=\"color: rgb(51, 51, 51);\"><span style=\"color: rgb(51, 51, 51);\">Skulle den ikke varme kan det også være noe galt med styringen til varmebatteriet.&nbsp;</span><br style=\"color: rgb(51, 51, 51);\"><span style=\"color: rgb(51, 51, 51);\">Er du filterkunde så får dere gratis support,eller et teknikker hjem til dere for å sjekke dette til en fast pris.</span>","$$hashKey":"object:68"},{"question":"Vi ønsker ikke å bytte filter selv, hva gjør jeg","answer":"<span style=\"color: rgb(51, 51, 51);\">Ring eller send en mail til Bare filter så setter vi deg i kontakt med en teknikker som har lang erfaring på dette.&nbsp;</span><br style=\"color: rgb(51, 51, 51);\"><span style=\"color: rgb(51, 51, 51);\">Vi tilbyr også vedlikeholdsavtaler på anlegg til Boligventilasjon til fastpris.</span>","$$hashKey":"object:70"},{"question":"Vi ønsker å bytte våres maskin til en nyere og bedre., hva gjør jeg","answer":"<span style=\"color: rgb(51, 51, 51);\">Husk som kunde får dere også rabatt på ny maskin.&nbsp;</span><br style=\"color: rgb(51, 51, 51);\"><span style=\"color: rgb(51, 51, 51);\">Ta kontakt med oss og dere får et tilbud på ny maskin ferdig montert</span>","$$hashKey":"object:72"},{"question":"Aggrigatleverandør sier at dersom vi bruker uorginale filter så gjelder ikke reklamasjonen.","answer":"<span style=\"color: rgb(51, 51, 51);\">Bare filter As kjøper alle filtera sine hos Interfil som er er en Norsk produsent.som også leverer til aggrigat leverandørene. Fra 1-1-17 er det blitt at filtera skal bli Eurovent godkjente filter til anlegg. vi leverer filter av den beste kvalitet til deres anlegg.</span>","$$hashKey":"object:74"}],"$$hashKey":"object:64"}]','', '', '2018-02-07 04:19:40', '2018-02-07 04:19:40');
