(172, 23, 1, 'hydropaint-collector', 'HydroPaint Collector', '', '112406', 'Leveres 0,9 x25 meter', '<h4>LSF HydroPaint Coll.</h4>\r\n\r\n<p><strong>LSF hc HydroPaint Collector er en grovfilterduk &nbsp;som er spesielt beregnet som avtrekksfilter (gulvfilter) i lakkeringsanlegg der det brukes vanntynnet lakk.</strong></p>\r\n\r\n<p>LSF hc HydroPaint Collector er produsert av sv&aelig;rt tynne og elastiske glassfibertr&aring;der som er lagt lagvis i en progressiv struktur. Hver enkelt fiber er impregnert med et bindemiddel. Dette sikrer en&nbsp;<strong>sv&aelig;rt god st&oslash;vlagringsevn</strong>e.</p>\r\n\r\n<p>Filterduken har sv&aelig;rt lang levetid sammenlignet&nbsp;med tilsvarende produkter p&aring;&nbsp;markedet. Lange serviceintervaller,&nbsp;<strong>kort&nbsp;nedetid</strong>&nbsp;i forbindelse med filterbytte,&nbsp;<strong>reduserte&nbsp;avfallsmengder</strong>&nbsp;og&nbsp;<strong>lavt trykkfal</strong>l&nbsp;sikrer&nbsp;<strong>god filter&oslash;konomi</strong>, og ikke minst&nbsp;<strong>lavt energiforbruk</strong>.</p>\r\n\r\n<p>LSF hc HydroPaint Collector vil bidra&nbsp;til en vesentlig&nbsp;<strong>kostnadsreduksjon</strong>&nbsp;i&nbsp;forhold til bruk av ordin&aelig;re lakkst&oslash;vfiltre.</p>\r\n\r\n<p>LSFhc HydroPaint Collector leveres som hele&nbsp;ruller p&aring; 0,5, 0,75 og 1 meter.&nbsp;Lengden p&aring; rullene er 25 meter.&nbsp;Filterduken kan ogs&aring; leveres ferdig&nbsp;kappet i den st&oslash;rrelsen du &oslash;nsker.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', '', '', '', 0, 0, 0, 2, 0, 3187, 10, '2018-01-25 03:51:06', '2018-01-25 03:51:07'),
