(196, 19, 1, 'ura-7', 'URA-7', '', '118869', '', '<h4>SuperFlow Alu M6</h4>\r\n\r\n<p><strong>SuperFlow Alu M6 (EN779:2012) er et kostnadseffektivt valg n&aring;r du trenger forfilter til ventilasjonsanlegg, eller et hovedfilter i prosessluftanlegg uten strenge krav til luftkvaliteten.</strong></p>\r\n\r\n<p>Filteret har&nbsp;<strong>glassfibermedie</strong>, og leveres med&nbsp;<strong>aluminiumsramme</strong>&nbsp;&ndash; markedets sterkeste metallramme. Den stabile rammekonstruksjonen letter arbeidet med filterskift.</p>\r\n\r\n<p>Den spesielle oppbyggingen av filtermediet&nbsp;bidrar sammen med Interfil&rsquo;s&nbsp;egenutviklede og spesielle poseform til&nbsp;et sv&aelig;rt<strong>&nbsp;lavt trykkfall</strong>&nbsp;og en&nbsp;<strong>god st&oslash;vlagringsevne</strong>.</p>\r\n\r\n<p>Innerrammene er ogs&aring; laget av aluminium.&nbsp;Aluminium omtales ofte som &ldquo;det&nbsp;gr&oslash;nne metallet&rdquo;. Det er et av de vanligste&nbsp;grunnstoffene i jordskorpen, og&nbsp;tilgangen er &aring; betrakte som ubegrenset.</p>\r\n\r\n<p>Interfil er den eneste filterprodusenten i&nbsp;Europa som bruker&nbsp;<strong>resirkulert</strong>&nbsp;aluminium&nbsp;i sine metallrammer. SuperFlow Alu&nbsp;er derfor et langt bedre&nbsp;<strong>milj&oslash;valg</strong>&nbsp;enn&nbsp;filter med b&aring;de st&aring;l- og plastrammer.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Spesielle fordeler</strong></p>\r\n\r\n<ul>\r\n	<li>Lavt trykkfall</li>\r\n	<li>God st&oslash;vlagringsevne</li>\r\n	<li>Markedets mest solide ramme</li>\r\n	<li>Ramme i resirkulert aluminium</li>\r\n	<li>Ramme kan leveres til gjenvinning</li>\r\n	<li>Sv&aelig;rt kort leveringstid</li>\r\n	<li>Norskprodusert filter</li>\r\n</ul>\r\n', '', '', '', 645, 450, 645, 2, 7, 812, 10, '2018-01-25 03:51:06', '2018-01-25 03:51:07'),
