(260, 27, 1, 'kullfilter-f7-404788', 'Kullfilter F7', '', '404788', '', '<h4>SuperFlow Duo F7 kullfilter</h4>\r\n\r\n<h4><strong>Kullfilteret SuperFlow Duo F7 gir effektiv beskyttelse mot b&aring;de helseskadelig svevest&oslash;v og gasser.</strong></h4>\r\n\r\n<p>Filteret er ogs&aring; egnet til<strong>&nbsp;fjerning av</strong>&nbsp;<strong>lukt</strong>.</p>\r\n\r\n<p>SuperFlow Duo F7 kullfilter stopper mye av det skadelige svevest&oslash;vet som finnes i lufta, for eksempel i&nbsp;<strong>byer og tettsteder</strong>. I omr&aring;der med sv&aelig;rt d&aring;rlig luftkvalitet/h&oslash;y luftforurensning.</p>\r\n\r\n<p>Filtermaterialet i SuperFlow Duo best&aring;r av to separate lag. Det f&oslash;rste er laget av et glassfibermateriale som stopper svevest&oslash;vpartiklene. Det ytterste laget inneholder&nbsp;<strong>aktivt kull som stopper ulike gassforurensninger</strong>.</p>\r\n', '', '', '', 210, 300, 210, 2, 4, 1004, 10, '2018-01-25 03:51:06', '2018-02-05 04:55:53'),
