(297, 23, 1, 'viledon-pa-560-m5', 'Viledon Pa 560 M5', '', '600051', 'Rull på 2x20 meter', '<h3>Viledon PA/560&nbsp;M5 (EN779:2012) er markedets beste takfilter til lakkbokser.</h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Bruker du Viledon PA/560 som takfilter, er du sikret&nbsp;<strong>maksimal beskyttelse mot st&oslash;vforurensning under lakkering</strong>. Resultatet blir et topp resultat p&aring; lakkeringsjobben, og forn&oslash;yde kunder. Og forn&oslash;yde kunder gir som kjent mer penger i kassa.</p>\r\n\r\n<p>Viledon PA/560 stopper i praksis 100% av alle&nbsp;partikler over 10 &mu;m. Dette er sv&aelig;rt viktig, ettersom denne st&oslash;rrelsen ogs&aring;&nbsp;vil v&aelig;re synlig i lakken dersom partiklene slipper&nbsp;gjennom filteret.</p>\r\n', 'takfilter - Filter til lakkboks | Barefilter.no', 'Tak filter til lakkboks', 'Bruker du Viledon PA/560 som takfilter, er du sikret maksimal beskyttelse mot støvforurensning under lakkering.', 0, 0, 0, 2, 0, 14502, 10, '2018-01-25 03:51:06', '2018-01-25 03:51:07'),
(298, 23, 1, 'viledon-287x592x330-3', 'Viledon 287x592x330-3', '', '610032', '', '<h3>Posefilteret Viledon G 35 SEL G3 stopper store partikler, har&nbsp;sv&aelig;rt god&nbsp;st&oslash;vlagringsevne, t&aring;ler ekstrem luftfuktighet og store luftmengder.</h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Viledon G 35 SEL kan med fordel brukes som avtrekksfilter i lakkeringsanlegg, eller som forfilter i luftinntak til gassturbiner og offshoreinstallasjoner.</p>\r\n\r\n<p>Filtermaterialet i Viledon G 35 SEL best&aring;r av en nowovenduk som er laget av elastiske syntetorganiske fibre.</p>\r\n\r\n<p>Posene i filteret er helsveiset, og smeltet inn i den robuste rammekonstruksjonen. Dette sikrer&nbsp;<strong>stabil ytelse under alle driftsforhold</strong>.</p>\r\n\r\n<p>Filteret er sikret mot mikrobakteriell vekst.</p>\r\n', 'Viledon- Filter til lakkboks| Barefilter.no', 'viledon G3', 'Viledon G 35 SEL kan med fordel brukes som avtrekksfilter i lakkeringsanlegg, eller som forfilter i luftinntak til gassturbiner og offshoreinstallasjon', 592, 330, 287, 2, 3, 861, 10, '2018-01-25 03:51:06', '2018-01-25 03:51:07'),
(299, 23, 1, 'viledon-492x592x330-4', 'Viledon 492x592x330-4', '', '610009', '', '<p>Den robuste utformingen gj&oslash;r at filteret blant annet er egnet som forfilter i luftinntak til&nbsp;<strong>gassturbiner</strong>&nbsp;og&nbsp;<strong>offshoreinstallasjoner</strong>, eller som avtrekksfilter i&nbsp;<strong>lakkeringsanlegg</strong>.</p>\r\n', 'Viledon- Filter til lakkboks| Barefilter.no', 'filter til lakkboks', 'Den robuste utformingen gjør at filteret blant annet er egnet som forfilter i luftinntak til gassturbiner og offshoreinstallasjoner, eller som avtrekksfilter i lakkeringsanlegg.', 592, 330, 492, 2, 4, 1099, 10, '2018-01-25 03:51:06', '2018-01-25 03:51:07'),
(300, 23, 1, 'viledon-592x592x330-5', 'Viledon 592x592x330-5', '', '610031', '', '<p>Den robuste utformingen gj&oslash;r at filteret blant annet er egnet som forfilter i luftinntak til&nbsp;<strong>gassturbiner</strong>&nbsp;og&nbsp;<strong>offshoreinstallasjoner</strong>, eller som avtrekksfilter i&nbsp;<strong>lakkeringsanlegg</strong>.</p>\r\n\r\n<p>Filtermaterialet&nbsp;i Viledon G35 S best&aring;r av en nonwovenduk som er laget av elastiske syntetiskorganiske fibre.</p>\r\n\r\n<p>Posene i filteret helsveiset, og smeltet inn i den robuste rammekonstruksjonen. Dette sikrer&nbsp;<strong>stabil ytelse</strong>&nbsp;under de fleste driftsforhold.</p>\r\n', 'Viledon- Filter til lakkboks| Barefilter.no', 'Filter til lakkeringshall', 'Den robuste utformingen gjør at filteret blant annet er egnet som forfilter i luftinntak til gassturbiner og offshoreinstallasjoner, eller som avtrekksfilter i lakkeringsanlegg.\r\n\r\nFiltermaterialet i Viledon G35 S består av en nonwovenduk som er laget av elastiske syntetiskorganiske fibre.', 592, 330, 592, 2, 5, 1280, 10, '2018-01-25 03:51:06', '2018-01-25 03:51:07'),
