(361, 26, 1, '230x430x48', '230x430x48', '', '127197', '', '<h4>SuperPleat Eco F7</h4>\r\n\r\n<p><strong>SuperPleat Eco F7 (EN779:2012) er et godt valg dersom du trenger et kortreist, norskprodusert filter som sikrer et godt inneklima.</strong></p>\r\n\r\n<p>Filterserien stopper en stor andel av det skadelige svevest&oslash;vet som finnes i omr&aring;der med h&oslash;y luftforurensning. Den gode partikkelutskillingen gj&oslash;r produktet godt egnet som hovedfilter i de fleste typer bygninger der det stilles h&oslash;ye krav til et<strong>&nbsp;godt inneklima</strong>.</p>\r\n\r\n<p>Den kompakte st&oslash;rrelsen gj&oslash;r at filteret passer spesielt godt i ventilasjonsanlegg med begrenset plass.</p>\r\n\r\n<p>Filtermediet er laget av glassfiberpapir. Dette er den sikreste suksessfaktoren til at filteret stopper det farlige svevest&oslash;vet.</p>\r\n', '', '', '', 430, 48, 230, 2, 0, 815, 10, '2018-01-25 03:51:06', '2018-01-25 03:51:07'),
(362, 23, 1, 'sfm-290-1x20m', 'SFM 290. 1x20m', '', '121240', 'Filterduk på rull', '<h4>Intermat SFM-290 G3</h4>\r\n\r\n<p><strong>Intermat SFM-290 G3 (EN779:2012)&nbsp;</strong><strong>er en grovfilterduk som er beregnet til luftinntak i maskiner og prosessluftanlegg, og som forfilter i diverse ventilasjonsanlegg.</strong></p>\r\n\r\n<p>Den syntetiske filterduken er produsert av polyesterfibre som er termisk bundet.</p>\r\n\r\n<p>Intermat SFM-290 G3 er progressivt&nbsp;oppbygd. Dette sikrer en god utnyttelse&nbsp;av hele filterarealet, og ikke minst&nbsp;et&nbsp;<strong>lavt trykkfall</strong>.</p>\r\n\r\n<p>Filteret har samme filterklasse som&nbsp;lillebroren SFM-150, men er tykkere,&nbsp;i tillegg til at det har en noe&nbsp;<strong>bedre&nbsp;st&oslash;vlagringsevne</strong>.</p>\r\n\r\n<p>Intermat SFM-290 har ogs&aring; en fargekoding for&nbsp;&aring; gj&oslash;re det enkelt &aring; sette filteret riktig&nbsp;inn der det skal brukes (hvit side er&nbsp;renluftsside).</p>\r\n', 'filterduk sfm 290', '', '', 0, 0, 0, 2, 0, 2018, 10, '2018-01-25 03:51:06', '2018-01-25 03:51:07'),
(363, 16, 1, 'if-85653x305x300', 'IF 85.653x305x300', '', '141579', '', '<h4>SuperFlow Alu F7</h4>\r\n\r\n<p><strong>SuperFlow Alu F7 (EN779:2012) er et sv&aelig;rt godt valg dersom du &oslash;nsker et kortreist, norskprodusert filter som sikrer et godt inneklima.</strong></p>\r\n\r\n<p>Filterserien stopper en sv&aelig;rt stor andel&nbsp;av det skadelige svevest&oslash;vet vi finner i&nbsp;lufta. Den h&oslash;ye partikkelutskillingen&nbsp;gj&oslash;r produktet sv&aelig;rt godt egnet som&nbsp;hovedfilter i de fleste typer ventilasjonsanlegg&nbsp;der det blir stilt h&oslash;ye krav til et&nbsp;<strong>godt inneklima</strong>.</p>\r\n\r\n<p>SuperFlow Alu F7 har&nbsp;<strong>glassfibermedie</strong>, og leveres med&nbsp;<strong>aluminiumsramme</strong>&nbsp;&ndash; markedets sterkeste metallramme. Den stabile rammekonstruksjonen letter arbeidet med filterskift.</p>\r\n\r\n<p>Innerrammene er ogs&aring; laget av aluminium.&nbsp;Aluminium omtales ofte som &ldquo;<strong>det&nbsp;gr&oslash;nne metallet</strong>&rdquo;. Det er et av de vanligste&nbsp;grunnstoffene i jordskorpen, og&nbsp;tilgangen er &aring; betrakte som ubegrenset.</p>\r\n', '', '', '', 305, 300, 653, 2, 10, 784, 10, '2018-01-25 03:51:06', '2018-01-25 03:51:07'),
(364, 24, 1, 'if-45-4', 'IF 45-4', '', '141576', '', '<h4>SuperFlow Alu M5</h4>\r\n\r\n<p><strong>SuperFlow Alu M5 (EN779:2012) er et kostnadseffektivt valg n&aring;r du trenger forfilter til ventilasjonsanlegg, eller et hovedfilter i prosessluftanlegg uten strenge krav til luftkvaliteten.</strong></p>\r\n\r\n<p>Filteret har&nbsp;<strong>glassfibermedie</strong>, og leveres med&nbsp;<strong>aluminiumsramme</strong>&nbsp;&ndash; markedets sterkeste metallramme. Den stabile rammekonstruksjonen letter arbeidet med filterskift.</p>\r\n\r\n<p>Den spesielle oppbyggingen av filtermediet&nbsp;bidrar sammen med Interfil&rsquo;s&nbsp;egenutviklede og spesielle poseform til&nbsp;et sv&aelig;rt<strong>&nbsp;lavt trykkfall</strong>&nbsp;og en&nbsp;<strong>god st&oslash;vlagringsevne</strong>.</p>\r\n', '', '', '', 653, 300, 250, 2, 4, 703, 10, '2018-01-25 03:51:06', '2018-01-25 03:51:07'),
