(390, 40, 1, 'viledon-nanopleat-f7', 'Viledon NanoPleat F7', '', '152682', '', '<h4>iledon NanoPleat F7</h4>\r\n\r\n<h3>Viledon NanoPleat F7&nbsp;(EN779:2012) er et kompaktfilter som er spesielt godt egnet som finfilter/hovedfilter i ventilasjonsanlegg med sv&aelig;rt fuktig luft.</h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>De vannavst&oslash;tende egenskapene gj&oslash;r filteret egnet i blant annet ulike offshoreinstallasjoner.</p>\r\n\r\n<p>Filtermediet i Viledon NanoPleat F7 er laget av s&aring;kalte hybridsyntetiske nanofiber.</p>\r\n\r\n<p>Mediet er resistent mot mikrobakteriell vekst, kjemikalier, og fuktighet opp til 100 % RH.&nbsp;<strong>Selv i direkte kontakt med fuktighet vil vanndr&aring;pene faktisk prelle av overflaten.&nbsp;</strong>Til og med trykkfallet forblir nesten uendret under disse forholdene.</p>\r\n\r\n<p>Filtermaterialet er stabilt og mekanisk sterkt. I kombinasjon med en solid plastramme, gir dette et robust ventilasjonsfilter som presterer under de fleste forhold.</p>\r\n\r\n<p>For &aring; forlenge levetiden til filteret, er det anbefalt &aring; bruke et forfilter.</p>\r\n\r\n<p>Viledon NanoPleat F7&nbsp;er 100 % forbrennbart, og kan derfor brukes som energikilde etter bruk.</p>\r\n\r\n<p><strong>Spesielle fordeler</strong></p>\r\n\r\n<ul>\r\n	<li>God filtreringsevne</li>\r\n	<li>Fuktbestandig</li>\r\n	<li>Lavt trykkfall</li>\r\n	<li>Sikret mot mikrobakteriell vekst</li>\r\n	<li>Brannklasse F1 (selvslukkende)</li>\r\n	<li>Kan brukes som energikilde etter bruk</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n', '', '', '', 592, 292, 287, 2, 0, 1357, 10, '2018-01-25 03:51:06', '2018-01-25 03:51:07'),
