(403, 26, 1, '450x800x45', '450x800x45', '', 'Pleat 100132', '', '<h4>SuperPleat Eco F7</h4>\r\n\r\n<p><strong>SuperPleat Eco F7 (EN779:2012) er et godt valg dersom du trenger et kortreist, norskprodusert filter som sikrer et godt inneklima.</strong></p>\r\n\r\n<p>Filterserien stopper en stor andel av det skadelige svevest&oslash;vet som finnes i omr&aring;der med h&oslash;y luftforurensning. Den gode partikkelutskillingen gj&oslash;r produktet godt egnet som hovedfilter i de fleste typer bygninger der det stilles h&oslash;ye krav til et<strong>&nbsp;godt inneklima</strong>.</p>\r\n\r\n<p>Den kompakte st&oslash;rrelsen gj&oslash;r at filteret passer spesielt godt i ventilasjonsanlegg med begrenset plass.</p>\r\n\r\n<p>Filtermediet er laget av glassfiberpapir. Dette er den sikreste suksessfaktoren til at filteret stopper det farlige svevest&oslash;vet.</p>\r\n\r\n<p>Den fysiske utformingen av filteret, der det er fokusert spesielt p&aring; en god pleatgeomteri, gir en optimal utnyttelse av hele arealet, og et<strong>&nbsp;lavt trykkfall</strong>sammenlignet med konkurrerende produkter.</p>\r\n\r\n<p>Rammematerialet i SuperPleat Eco er laget av plast.</p>\r\n\r\n<p>Filteret er 100 % forbrennbart, og kan derfor brukes som&nbsp;<strong>energikilde</strong>&nbsp;etter bruk.</p>\r\n', '', '', '', 800, 45, 450, 2, 0, 793, 10, '2018-01-25 03:51:06', '2018-01-25 03:51:07'),
