(427, 16, 1, 'if-85-200x225x300', 'IF 85-200x225x300', '', '400760', 'F7 posefilter', '<h4>SuperFlow Alu F7</h4>\r\n\r\n<p><strong>SuperFlow Alu F7 (EN779:2012) er et sv&aelig;rt godt valg dersom du &oslash;nsker et kortreist, norskprodusert filter som sikrer et godt inneklima.</strong></p>\r\n\r\n<p>Filterserien stopper en sv&aelig;rt stor andel&nbsp;av det skadelige svevest&oslash;vet vi finner i&nbsp;lufta. Den h&oslash;ye partikkelutskillingen&nbsp;gj&oslash;r produktet sv&aelig;rt godt egnet som&nbsp;hovedfilter i de fleste typer ventilasjonsanlegg&nbsp;der det blir stilt h&oslash;ye krav til et&nbsp;<strong>godt inneklima</strong>.</p>\r\n\r\n<p>SuperFlow Alu F7 har&nbsp;<strong>glassfibermedie</strong>, og leveres med&nbsp;<strong>aluminiumsramme</strong>&nbsp;&ndash; markedets sterkeste metallramme. Den stabile rammekonstruksjonen letter arbeidet med filterskift.</p>\r\n\r\n<p>Innerrammene er ogs&aring; laget av aluminium.&nbsp;Aluminium omtales ofte som &ldquo;<strong>det&nbsp;gr&oslash;nne metallet</strong>&rdquo;. Det er et av de vanligste&nbsp;grunnstoffene i jordskorpen, og&nbsp;tilgangen er &aring; betrakte som ubegrenset.</p>\r\n\r\n<p>Interfil er den eneste filterprodusenten i&nbsp;Europa som bruker&nbsp;<strong>resirkulert</strong>&nbsp;aluminium&nbsp;i sine metallrammer. SuperFlow Alu&nbsp;er derfor et langt bedre&nbsp;<strong>milj&oslash;valg</strong>&nbsp;enn&nbsp;filter med b&aring;de st&aring;l- og plastrammer.</p>\r\n', '', '', '', 225, 300, 200, 2, 3, 680, 10, '2018-01-25 03:51:06', '2018-01-25 03:51:07'),
(428, 16, 1, 'if-85-115x225x360', 'IF-85 115x225x360', '', '142017', 'F7 filter', '<h4>SuperFlow Alu F7</h4>\r\n\r\n<p><strong>SuperFlow Alu F7 (EN779:2012) er et sv&aelig;rt godt valg dersom du &oslash;nsker et kortreist, norskprodusert filter som sikrer et godt inneklima.</strong></p>\r\n\r\n<p>Filterserien stopper en sv&aelig;rt stor andel&nbsp;av det skadelige svevest&oslash;vet vi finner i&nbsp;lufta. Den h&oslash;ye partikkelutskillingen&nbsp;gj&oslash;r produktet sv&aelig;rt godt egnet som&nbsp;hovedfilter i de fleste typer ventilasjonsanlegg&nbsp;der det blir stilt h&oslash;ye krav til et&nbsp;<strong>godt inneklima</strong>.</p>\r\n\r\n<p>SuperFlow Alu F7 har&nbsp;<strong>glassfibermedie</strong>, og leveres med&nbsp;<strong>aluminiumsramme</strong>&nbsp;&ndash; markedets sterkeste metallramme. Den stabile rammekonstruksjonen letter arbeidet med filterskift.</p>\r\n\r\n<p>Innerrammene er ogs&aring; laget av aluminium.&nbsp;Aluminium omtales ofte som &ldquo;<strong>det&nbsp;gr&oslash;nne metallet</strong>&rdquo;. Det er et av de vanligste&nbsp;grunnstoffene i jordskorpen, og&nbsp;tilgangen er &aring; betrakte som ubegrenset.</p>\r\n\r\n<p>Interfil er den eneste filterprodusenten i&nbsp;Europa som bruker&nbsp;<strong>resirkulert</strong>&nbsp;aluminium&nbsp;i sine metallrammer. SuperFlow Alu&nbsp;er derfor et langt bedre&nbsp;<strong>milj&oslash;valg</strong>&nbsp;enn&nbsp;filter med b&aring;de st&aring;l- og plastrammer.</p>\r\n', '', '', '', 225, 360, 115, 2, 2, 387, 10, '2018-01-25 03:51:06', '2018-01-25 03:51:07'),
(429, 14, 1, 'casa-r7-r7h', 'Casa R7-R7H', '', '800338', 'Komplett filtersett', '<p>Komlett filtersett Casa R7 best&aring;r av:</p>\r\n\r\n<p>1 stk tilluft superpleat F7 315x680x45</p>\r\n\r\n<p>1 stk avtrekk superpleat F7 315x680x45</p>\r\n\r\n<p>Filtersettet kommer fra Norsk produsent.</p>\r\n\r\n<p>Dersom du velger abbonomen har vi ingen oppsigelsetid.</p>\r\n', '', '', '', 0, 0, 0, 2, 0, 685, 10, '2018-01-25 03:51:06', '2018-01-25 03:51:07'),
(430, 9, 1, 'regokomfovent-c1-og-c3', 'Rego/Komfovent C1 og C3', '', '810075', 'Komplett filtersett', '<p>Komplett filtersett Rego/komfovent 300-C1 og C3</p>\r\n\r\n<p>1 stk Tilluft F7 filter 200x410x24</p>\r\n\r\n<p>1 stk Avtrekk F7 filter 200x410x24</p>\r\n\r\n<p>Filtersetta kommer fra Norsk produsent.</p>\r\n\r\n<p>Dersom du velger abbonomang s&aring; har vi ingen oppsigelse tid.</p>\r\n', '', '', '', 0, 0, 0, 2, 0, 468, 10, '2018-01-25 03:51:06', '2018-01-25 03:51:07'),
(431, 46, 1, 'vtr-300-kullfilter', 'VTR 300 Kullfilter', '', '812139', 'OBS: Fjerner lukt.\r\n', '<p>Dette filtersettet egner seg dersom du er plaget med lukt som ekso-r&oslash;k eller matlukt.</p>\r\n\r\n<p>Filtersettet er kmplett og innholder.</p>\r\n\r\n<p>1 stk Super Duo F7p tilluft 135x389x500-2</p>\r\n\r\n<p>1 st IF-35sp avtrekk 135x389x300-2</p>\r\n\r\n<p>Filtersettet kommer fra Norsk produsent.</p>\r\n', '', '', '', 0, 0, 0, 2, 0, 731, 10, '2018-01-25 03:51:06', '2018-01-25 03:51:07'),
(432, 10, 1, 'vallox-150-effect', 'Vallox 150 Effect', '', 'bf1546', 'Komplett filtersett\r\nkommer i løpet av November', '<p>KOmplett filterset til Vallox 150 best&aring;r av:</p>\r\n\r\n<p>1 stk superpleat F/ 272x545x48p</p>\r\n\r\n<p>2 stk SFM 290 filterduk. 233x546</p>\r\n\r\n<p>Filtersettet kommer fra Norsk produsent</p>\r\n', '', '', '', 0, 0, 0, 2, 0, 0, 10, '2018-01-25 03:51:06', '2018-01-25 03:51:07'),
