INSERT INTO `product_categories` (`id`, `type_id`, `parent_id`, `priority`, `handle`, `active`, `name`, `description`, `meta_title`, `meta_keywords`, `meta_description`, `image`, `created_at`, `updated_at`) VALUES
(3, 1, 0, 10, 'boventcovent', 1, 'Bovent/Covent', '<p>Covent var forut for sin tid p&aring; syttitallet og driver fortsatt et kontinuerlig utviklingsarbeid, b&aring;de for &aring; forbedre og forenkle allerede eksisterende produkter; samt &aring; finne nye anvendelsesmuligheter for dem. Dessuten endres markedets behov over tid, og nye produkter m&aring; erstatte de gamle. Nytenkning og produktutvikling er et team-arbeid der bedriftens fagkompetanse utnyttes maksimalt</p>\r\n\r\n<p><span style="font-size:20px">Vi Leverer Norskproduserte filter av h&oslash;y kvalitet!</span></p>\r\n', 'ventilasjonsfilter Bovent/Covent - Filter til Bovent| Barefilter.no', 'Filter til ventilasjonsanlegget deres har Bare filter AS', 'Kvalitetsfilter fra Norsk produsent.', '8bcfjell-med-snø-og-blaatt-vann.jpg', '2018-01-25 03:51:06', '2018-01-25 03:51:06'),
(4, 1, 0, 10, 'enervent', 1, 'Enervent', '<p>Ener-Produkt AS er en kompetansebasert bedrift som med over 25 &aring;rs erfaring innen ventilasjon og varme leverer produkter og kunnskap av h&oslash;yeste kvalitet med innovative tekniske l&oslash;sninger. Kvalitet g&aring;r aldri av moten, derfor satser vi p&aring; produkter som gir deg som kunde merverdi og kvalitetsmessige fordeler. Bedriften har spesialisert seg p&aring; produkter innen inneklima og varme, med spesielt fokus p&aring; l&oslash;sninger for nordisk klima..</p>\r\n\r\n<p><span style="font-size:20px">Vi Leverer Norskproduserte filter av h&oslash;y kvalitet.!</span></p>\r\n', 'ventilasjonsfilter  - Filter til Enervent | Barefilter.no', 'Vi har filter til alle formål', 'filter til ventilasjon-support-abbonoment-og erfaring som teknikker i mange år,og hjelper våres kunder dersom noe problemer oppstår.', '274fossefall-i-naturen-frisk-luft.jpg', '2018-01-25 03:51:06', '2018-01-25 03:51:06'),
(5, 1, 0, 10, 'ensy', 1, 'Ensy', '<p style="text-align:center">&nbsp;</p>\r\n\r\n<p><span style="font-size:20px">Vi Leverer Norskproduserte filter av h&oslash;y kvalitet.!</span></p>\r\n', 'filter til ventilasjon  - Filter til Ensy | Barefilter.no', 'Vi har filter til alle formål,leveres direkte fra fabrikk i Norge', 'Filterpakken blir levert i komplette sett,velg leveringsmåte i butikken, om du ønsker abboonoment kan dette velges selv etter ønske når du er logget inn i butikken.', '4c1fossefall-med-skyer-og-traer.jpg', '2018-01-25 03:51:06', '2018-01-25 03:51:06'),
(6, 1, 0, 1, 'flexit', 1, 'Flexit', '<h4>Ren og frisk luft for et sunt innemilj&oslash;</h4>\r\n\r\n<p>Flexit utvikler, produserer og markedsf&oslash;rer energieffektive produkter, tjenester og l&oslash;sninger for ren og frisk luft til boliger og yrkesbygg.</p>\r\n\r\n<p>Vi &oslash;nsker &aring; gj&oslash;re det mulig for alle &aring; leve sunt innend&oslash;rs ved &aring; gj&oslash;re det enkelt og l&oslash;nnsomt &aring; sikre seg mot :</p>\r\n\r\n<p><span style="font-size:20px">Vi Leverer Norskproduserte filter av h&oslash;y kvalitet.!</span></p>\r\n', 'Flexit filter  - Filter til Flexit| Barefilter.no', 'Vi har filterpakker og 25 år innen bransjen', 'Support-abbonoment-chatt, ta kontakt da vi er stort sett tilgjengelig,også i helgene.', 'c73fresh-air-villavent-systemair.jpg', '2018-01-25 03:51:06', '2018-01-25 03:51:06'),
(7, 1, 0, 3, 'heru', 1, 'Heru', '<h4>En mann med visjoner</h4>\r\n\r\n<p>I begynnelsen av 1970-tallet var radialvifter b&aring;de dyre, st&oslash;yende og plasskrevende. Hans &Ouml;stberg hadde en visjon om en vifte som var effektiv, lett &aring; montere og som krevde minimal plass. Resultatet ble den sirkul&aelig;re kanalvifta som i dag er et begrep over hele verden.</p>\r\n\r\n<p><span style="font-size:20px">Vi Leverer Norskproduserte filter av h&oslash;y kvalitet.!</span></p>\r\n', 'Filter til heru  - ventilasjonsfilter til Heru | Barefilter.no', 'Stort utvalg-levering direkte fra interfil', 'Kvalitetsfilter,til gode priser,som kunde hos Bare filter AS så får dere god hjelp at teknikker dersom  dere trenger suppport,25 år i bransjen.', 'e0afrisk-luft-filter-til-bovent-covent.jpg', '2018-01-25 03:51:06', '2018-01-25 03:51:06'),
(8, 1, 0, 5, 'nilan', 1, 'Nilan', '<p><strong>Nilan Norge</strong></p>\r\n\r\n<p>Vi anser v&aring;re anlegg til &aring; v&aelig;re en del&nbsp;av bygningen. Et ventilasjonsanlegg med&nbsp;filter til Nilan&nbsp;skal kunne kj&oslash;re 24 timer i d&oslash;gnet, alle dager, i l&oslash;pet av et &aring;r. Vi leverer installasjon, support og teknisk service&nbsp;for alle v&aring;re ventilasjonsfilter til Nilan. &Oslash;nsker du levering 2 ganger i &aring;ret for ditt Nilan ventilasjonsanlegg kan du tegne et abonnement og f&aring; gode rabatter p&aring; bestillingen.</p>\r\n\r\n<p><span style="font-size:20px">Vi Leverer Norskproduserte filter av h&oslash;y kvalitet.!</span></p>\r\n', 'ventilasjonsfilter  - Filter til Nilan | Barefilter.no', 'filter til nilan, nilan, Nilan, filtersett, filter, ventilasjonsfilter', 'Vi leverer ventilasjonsfilter til Nilan med installasjon, support og teknisk service. Chat med oss i dag for bestilling og support av filter til Nilan.', '7dbgront-og-skinnende-gress.jpg', '2018-01-25 03:51:06', '2018-01-25 03:51:06'),
(9, 1, 0, 10, 'regokomfovent', 1, 'Rego/Komfovent', '<p>&nbsp;</p>\r\n\r\n<p><span style="font-size:20px">Vi Leverer Norskproduserte filter av h&oslash;y kvalitet.!</span></p>\r\n', 'ventilasjonfilter til Rego  - Filter til Rego | Barefilter.no', 'Vi har og kan dette med filter.', 'Bare filter har 25 år bakgrunn innen klimateknikk og vi hjelper våres kunder.', '36afrisk-luft-fra-trær-med-solnedgang.jpg', '2018-01-25 03:51:06', '2018-01-25 03:51:06'),
(10, 1, 0, 10, 'vallox', 1, 'Vallox', '<p><span style="font-size:20px">Vi Leverer Norskproduserte filter av h&oslash;y kvalitet.!</span></p>\r\n', 'ventilasjonsfilter Vallox  - Filter til Vallox | Barefilter.no', 'Vi har abbonoment-kundeservice /shatt til våres kunder', 'Trenger du hjelp med ditt anlegg,? dersom du er kunde hos Bare filter AS får du gratis support.', '2e0frisk-luft-med-filter-til-flexit.jpg', '2018-01-25 03:51:06', '2018-01-25 03:51:06'),
(11, 1, 0, 2, 'villaventsystemair', 1, 'Villavent/Systemair', '<p>Systemair er en av de&nbsp;ledende ventilasjonsleverand&oslash;rene p&aring; det norske markedet, med lang erfaring og h&oslash;y kompetanse. Vi har bransjens bredeste produktspekter&nbsp;innen ventilasjonsutstyr til b&aring;de n&aelig;rings- og boligbygg. 120 engasjerte medarbeidere omsatte for ca. 500 mill. NOK i 2015.&nbsp;</p>\r\n\r\n<p>Systemair har salgskontorer i Sandnes, Bergen, Oslo og Trondheim samt varelager p&aring; Eidsvoll og i Sandnes.</p>\r\n\r\n<p><span style="font-size:20px">Vi Leverer Norskproduserte filter av h&oslash;y kvalitet!</span></p>\r\n', 'filtersett  - Filter til Villavent/systemair | Barefilter.no', 'Filter til boligventilasjon og industrifilter', 'Vi har/skaffer filteret dere trenger til gode priser,som kunde får dere også support dersom feil oppstår på maskinen.', 'c61filter-på-skog.jpg', '2018-01-25 03:51:06', '2018-01-25 03:51:06'),
(12, 1, 0, 4, 'exvent', 1, 'Exvent', '<p>Det som betegner en behagelig ventilasjon, er at inneklimaet er sunt og har en jevn kvalitet &ndash; helt uavhengig av v&aelig;ret ute og forholdene inne. Vi har detaljerte kunnskaper om sunn inneluft, energieffektivitet samt effektiv varmegjenvinning. Avanserte klimaanlegg til hus i forskjellige st&oslash;rrelser har v&aelig;rt kjernen i virksomheten v&aring;r helt fra 1983.</p>\r\n\r\n<p><span style="font-size:20px">Vi Leverer Norskproduserte filter av h&oslash;y kvalitet.!</span></p>\r\n', 'xvent  - Filter til Exvent | Barefilter.no', 'Vi kar kvalitetsfilter til ditt anlegg', 'Som kunde får du hjelp dersom problemet oppstår med ditt anlegg.', '540mektig-natur-med-fossefall-og-skog.jpg', '2018-01-25 03:51:06', '2018-01-25 03:51:06'),
(13, 1, 0, 10, 'salda', 1, 'Salda', '<p>Litt om Salda</p>\r\n\r\n<p>Salda UAB er ledende i Europa innen produksjon av ventilasjonsutstyr, med mer enn 25 &aring;rs erfaring i feltet<em>.</em>&nbsp;I mer enn 30 land tilbyr salda&nbsp;ventilasjonsutstyr for store industribedrifter, produksjonsanlegg, kontorer, kafeer, hoteller samt enkelte hjem.&nbsp;Salda UAB avansert ventilasjonsl&oslash;sninger som luftbehandlingsaggregater med varmegjenvinning spare opp til 94 prosent av varmeenergi i avkastluften.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style="font-size:20px">Vi Leverer Norskproduserte filter av h&oslash;y kvalitet.!</span></p>\r\n', 'filter til ventilasjon  - Filter til Salda | Barefilter.no', 'Filtersetta til Sald er av beste kvalitet og leveres fra Norsk produsent', 'Bare filter AS gir support-abbonomang og rabatt på reservedeler dersom du er kunde hos oss.', '307front.jpg', '2018-01-25 03:51:06', '2018-01-25 03:51:06'),
(14, 1, 0, 10, 'swegoncasa-ilto', 1, 'Swegon/Casa- Ilto', '<p>Kundeforst&aring;else handler om &aring; se gjennom kundens &oslash;yne og virkelig sette seg inn i og forst&aring; deres utfordringer. F&oslash;rst da kan vi tilby l&oslash;sninger som genererer riktig verdi.</p>\r\n\r\n<p>Dette betyr at vi:<br />\r\n◾er interessert i og kjent med v&aring;re kunders virksomhet og utfordringer<br />\r\n◾drevet av et oppriktig &oslash;nske om &aring; finne den beste l&oslash;sningen for hver enkelt kunde</p>\r\n\r\n<p><span style="font-size:20px">Vi Leverer Norskproduserte filter av h&oslash;y kvalitet!</span></p>\r\n', 'Swegon / Casa- Ilto - Filter til Caca| Barefilter.no', 'Vi har det meste av filter', 'skulle du ikke finne filteret du ser etter,send en chatt/mail så legger vi dette i butikken våres', '365trees.jpg', '2018-01-25 03:51:06', '2018-01-25 03:51:06'),
(16, 2, 0, 10, 'f7-industrifilter', 1, 'F7 Industrifilter', '<div class="wpb_text_column wpb_content_element ">\r\n<div class="wpb_wrapper">\r\n<p><strong>SuperFlow Alu F7 (EN779:2012) er et sv&aelig;rt godt valg dersom du &oslash;nsker et kortreist, norskprodusert filter som sikrer et godt inneklima.</strong></p>\r\n\r\n<p>Filterserien stopper en sv&aelig;rt stor andel&nbsp;av det skadelige svevest&oslash;vet vi finner i&nbsp;lufta. Den h&oslash;ye partikkelutskillingen&nbsp;gj&oslash;r produktet sv&aelig;rt godt egnet som&nbsp;hovedfilter i de fleste typer ventilasjonsanlegg&nbsp;der det blir stilt h&oslash;ye krav til et&nbsp;<strong>godt inneklima</strong>.</p>\r\n\r\n<ul>\r\n</ul>\r\n</div>\r\n</div>\r\n', 'F7 filter - Filter til ventilasjon | Barefilter.no', 'ventilasjonsfilter F7 ', 'Filterserien stopper en svært stor andel av det skadelige svevestøvet vi finner i lufta. Den høye partikkelutskillingen gjør produktet svært godt egnet som hovedfilter i de fleste typer ventilasjonsanlegg der det blir stilt høye krav til et godt inneklima.', '411superflow-duo-f7.jpg', '2018-01-25 03:51:06', '2018-01-25 03:51:06'),
(19, 2, 0, 10, 'm6-industrifilter', 1, 'M6 Industrifilter', '<p>Filteret har&nbsp;<strong>glassfibermedie</strong>, og leveres med&nbsp;<strong>aluminiumsramme</strong>&nbsp;&ndash; markedets sterkeste metallramme. Den stabile rammekonstruksjonen letter arbeidet med filterskift.</p>\r\n\r\n<p>Den spesielle oppbyggingen av filtermediet&nbsp;bidrar sammen med Interfil&rsquo;s&nbsp;egenutviklede og spesielle poseform til&nbsp;et sv&aelig;rt<strong>&nbsp;lavt trykkfall</strong>&nbsp;og en&nbsp;<strong>god st&oslash;vlagringsevne</strong>.</p>\r\n', '', '', '', 'd03produkter-superflow-alu-m6 (2).jpg', '2018-01-25 03:51:06', '2018-01-25 03:51:06'),
(23, 2, 0, 10, 'filter-til-til-lakkbokser', 1, 'Filter til Til Lakkbokser', '<p>Vi skaffer alt av ventilasjonsfilter til lakkbokser,skulle du trenge feks en filterduk s&aring; kan den bestilles etter m&aring;l til ditt anlegg, vi legger inn flere&nbsp;produkter&nbsp;fortl&oslash;pende.</p>\r\n\r\n<p>Et godt utf&oslash;rt h&aring;ndverk, i kombinasjon med kvalitetsverkt&oslash;y og kvalitetslakk, er avgj&oslash;rende for en speilblank overflate. Men er du klar over at ogs&aring; valg av filter er kritisk for hvordan resultatet blir?</p>\r\n', 'filter- Filter til lakkboks| Barefilter.no', 'filter til lakkboks', 'Vi birdrar til speilblanke overflater,det du finner i nettbutikken er et utvalg.', 'e3blakkboks.jpg', '2018-01-25 03:51:06', '2018-01-25 03:51:06'),
(24, 2, 0, 10, 'm5-industrifilter', 1, 'M5 Industrifilter', '<h4>SuperFlow Alu M5</h4>\r\n\r\n<p><strong>SuperFlow Alu M5 (EN779:2012) er et kostnadseffektivt valg n&aring;r du trenger forfilter til ventilasjonsanlegg, eller et hovedfilter i prosessluftanlegg uten strenge krav til luftkvaliteten.</strong></p>\r\n\r\n<p>Filteret har&nbsp;<strong>glassfibermedie</strong>, og leveres med&nbsp;<strong>aluminiumsramme</strong>&nbsp;&ndash; markedets sterkeste metallramme. Den stabile rammekonstruksjonen letter arbeidet med filterskift.</p>\r\n\r\n<p>&nbsp;</p>\r\n', '', '', '', '36aprodukter-superflow-alu-m5.jpg', '2018-01-25 03:51:06', '2018-01-25 03:51:06'),
(26, 2, 0, 10, 'super-pleat-eco-f7-48mm', 1, 'Super Pleat Eco F7 48mm', '<h4>SuperPleat Eco F7</h4>\r\n\r\n<p><strong>SuperPleat Eco F7 (EN779:2012) er et godt valg dersom du trenger et kortreist, norskprodusert filter som sikrer et godt inneklima.</strong></p>\r\n\r\n<p>Filterserien stopper en stor andel av det skadelige svevest&oslash;vet som finnes i omr&aring;der med h&oslash;y luftforurensning. Den gode partikkelutskillingen gj&oslash;r produktet godt egnet som hovedfilter i de fleste typer bygninger der det stilles h&oslash;ye krav til et<strong>&nbsp;godt inneklima</strong>.</p>\r\n', '', '', '', 'e1cprodukter-superpleat-eco-450x450px.jpg', '2018-01-25 03:51:06', '2018-01-25 03:51:06'),
(27, 2, 0, 10, 'kullfilter-f7', 1, 'Kullfilter F7', '<h4>SuperFlow Duo F7 kullfilter</h4>\r\n\r\n<h4><strong>Kullfilteret SuperFlow Duo F7 gir effektiv beskyttelse mot b&aring;de helseskadelig svevest&oslash;v og gasser.</strong></h4>\r\n\r\n<p>Filteret er ogs&aring; egnet til<strong>&nbsp;fjerning av</strong>&nbsp;<strong>lukt</strong>.</p>\r\n\r\n<p>SuperFlow Duo F7 kullfilter stopper mye av det skadelige svevest&oslash;vet som finnes i lufta, for eksempel i&nbsp;<strong>byer og tettsteder</strong>.&nbsp;</p>\r\n', 'kullfilter', 'kullfilter', 'kullfilter F7', 'e79Kullfilter F7.jpg', '2018-01-25 03:51:06', '2018-01-25 03:51:06'),
(30, 2, 0, 10, 'superpleat-m5', 1, 'SuperPleat M5', '<p>Filtermaterialet er laget av glassfiberpapir. Den fysiske utformingen av filtermaterialet, der det er satt spesielt fokus p&aring; en god pleatgeometri, gir en optimal utnyttelse av hele filterarealet, og et lavt trykkfall sammenlignet med konkurrerende produkter.</p>\r\n', '', '', '', 'ab6Superpleat Eco F7 48mm.jpg', '2018-01-25 03:51:06', '2018-01-25 03:51:06'),
(31, 2, 0, 10, 'heru-suxess', 1, 'Heru Suxess', '<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style="font-size:24px">Filtersett fra Norsk Produsent</span></p>\r\n', '', '', '', 'd49IMG_2608-1280x500.jpg', '2018-01-25 03:51:06', '2018-01-25 03:51:06'),
(32, 2, 0, 10, 'systemair-industrimaskiner', 1, 'Systemair Industrimaskiner', '<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Vi leverer kun Norskproduserte filter.</p>\r\n', '', '', '', 'c1aIMG_2608-1280x500.jpg', '2018-01-25 03:51:06', '2018-01-25 03:51:06'),
(33, 2, 0, 10, 'exhausto-vex-', 1, 'Exhausto vex ', '<p>&nbsp;</p>\r\n\r\n<p>FLERE PRODUKTER KOMMER.</p>\r\n', '', '', '', 'a16IMG_2608-1280x500.jpg', '2018-01-25 03:51:06', '2018-01-25 03:51:06'),
(34, 2, 0, 10, 'envistar', 1, 'Envistar', '<p>Vi legger inn nye produkter hver dag.</p>\r\n', 'Filter til Envistar', '', '', '7f1IMG_2608-1280x500.jpg', '2018-01-25 03:51:06', '2018-01-25 03:51:06'),
(35, 2, 0, 10, 'swegon-gold-compact', 1, 'Swegon / Gold - Compact', '', 'Filtersett til Gold- Compact', '', '', 'a58IMG_2608-1280x500.jpg', '2018-01-25 03:51:06', '2018-01-25 03:51:06'),
(36, 2, 0, 10, 'novema-', 1, 'Novema ', '<p>&nbsp;</p>\r\n\r\n<p>Vi jobber med denne siden &aring; legger inn flere produkter.</p>\r\n', '', '', '', '7b9IMG_2608-1280x500.jpg', '2018-01-25 03:51:06', '2018-01-25 03:51:06'),
(37, 2, 0, 10, 'flexit-industri', 1, 'Flexit Industri', '', '', '', '', '8d7IMG_2608-1280x500.jpg', '2018-01-25 03:51:06', '2018-01-25 03:51:06'),
(38, 2, 0, 10, 'flkt-woods', 1, 'Flàkt Woods', '', '', '', '', 'f7bIMG_2608-1280x500.jpg', '2018-01-25 03:51:06', '2018-01-25 03:51:06'),
(39, 1, 0, 10, 'nibe-', 1, 'NIBE ', '', '', '', '', 'c57front.jpg', '2018-01-25 03:51:06', '2018-01-25 03:51:06'),
(40, 2, 0, 10, 'viledon-nanopleat-f7', 1, 'Viledon NanoPleat F7', '<h4>Viledon NanoPleat F7</h4>\r\n\r\n<h4>De vannavst&oslash;tende egenskapene gj&oslash;r filteret egnet i blant annet ulike offshoreinstallasjoner./Sv&oslash;mmebasseng</h4>\r\n\r\n<p>Filtermediet i Viledon NanoPleat F7 er laget av s&aring;kalte hybridsyntetiske nanofiber.</p>\r\n\r\n<p>Mediet er resistent mot mikrobakteriell vekst, kjemikalier, og fuktighet opp til 100 % RH.&nbsp;<strong>Selv i direkte kontakt med fuktighet vil vanndr&aring;pene faktisk prelle av overflaten.&nbsp;</strong>Til og med trykkfallet forblir nesten uendret under disse forholdene.</p>\r\n\r\n<p>Filtermaterialet er stabilt og mekanisk sterkt. I kombinasjon med en solid plastramme, gir dette et robust ventilasjonsfilter som presterer under de fleste forhold.</p>\r\n\r\n<p>&nbsp;</p>\r\n', '', '', '', '00fNanoPleat F7.jpg', '2018-01-25 03:51:06', '2018-01-25 03:51:06'),
